<h2>Poprawiony wykres</h2>
<p>Przy uyciu programu Inkscape dokonaam nastpujcych korekt:</p>
<ul>
<li>zmieniam umiejscowienie i kolor opisw na mapie</li>
<li>dodaam tytu wykresu</li>
<li>powikszyam i poprawiam podpisy osi</li>
<li>poprawiam opis legendy</li>
